  function checkscrolllock(div) {
    var sum = (div.scrollHeight - div.scrollTop);

    if (sum >= (parseFloat(div.clientHeight) - 3) && sum <= (parseFloat(div.clientHeight) + 3)) { //if sum is within 3 pixels either way means it is scrolled down
      return true;
    } else {
      return false;
    }
  } //end of checkscrolllock

  function decidescroll(div, scrolllock) {
    if (scrolllock == true) { //so if it's already scrolled down before we placed stuff, we'll scroll down again
      div.scrollTop = div.scrollHeight;
    }
  } //end of decidescroll


  function gettime() {
    var timeformat;
    timeformat = "AMPM";

    var currentTime = new Date();
    var hours = currentTime.getHours();
    var minutes = currentTime.getMinutes();
    console.log(hours, minutes);
    var ampm;
    if (minutes < 10) {
      minutes = "0" + minutes;
    }
    if (timeformat == "AMPM") {
      if (hours >= 12) {
        ampm = "PM";
        if (hours > 12) {
          hours = hours - 12;
        }

      } else {
        ampm = "AM";
      }
      if (hours == 0) {
        hours = 12;
      }
      return (hours + ":" + minutes + " " + ampm + " ");
    }
    if (timeformat == "24") {
      if (hours < 10) {
        hours = "0" + hours;
      }
      return (hours + ":" + minutes);
    }

  } //end of gettime

